        image: "https://via.placeholder.com/300",
    },
    {
        id: 2,
        name: "Art Exhibition",
        date: "2023-10-20",
        location: "Downtown Gallery",
        description: "Explore the latest contemporary art.",
        image: "https://via.placeholder.com/300",
    },
    {
        id: 3,
        name: "Food Truck Rally",
        date: "2023-10-25",
        location: "City Square",
        description: "Taste delicious food from local trucks.",
        image: "https://via.placeholder.com/300",
    },
];

